import * as React from 'react';
import { StyleSheet, Button, View, Text } from 'react-native';

export default function Details({ navigation }) {
  const pressHandler = () => {
    navigation.goBack();
  }
  return (
    <View>
      <Text></Text>
      <Button onPress={pressHandler} />
    </View>
  )
}
